<h1 class="Section4">
<a class="Section5" href="#" id="sortie-du-programme">Sortie du programme</a>
</h1>
<div class="Section6"><br>Nous essayerons d'ouvrir un fichier inexistant en mode lecture, cela génèrera une erreur que nous exploiterons pour sortir du programme avec un code d'erreur (EXIT_FAILURE). En cas de succès, il faudra utiliser le code de sortie (EXIT_SUCCESS). Ouvrir un éditeur de texte selon votre choix (Notepad++). Editer le programme C. Exécuter le programme.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#ligne-de-commande_programme-principal">Programme principal</a>
