</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ligne-de-commande_programme-principal" href="#sortie-du-programme">Programme principal</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
#include &lt;stdio.h&gt;
#include &lt;stdlib.h&gt;
//===============================================
int main(int _argc, char** _argv) {
    FILE* lFile = fopen("sans_titre.txt", "r");
    if(lFile == 0) {
        printf("L'ouverture du fichier a echoue.\n");
        exit(EXIT_FAILURE);
    }
    printf("L'ouverture du fichier a reussi.\n");
    exit(EXIT_SUCCESS);
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ligne-de-commande_resultat" href="#sortie-du-programme">Résultat</a>
</h2><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="recursivite">Récursivité</a>
</h1>
<div class="Section6"><br>Nous essayerons de déterminer la factorielle d'un nombre entier naturel (n). En mathématiques, la factorielle d'un entier naturel (n) est le produit des nombres entiers naturels strictement positifs inférieurs ou égaux à (n). Cela signifie que la factorielle de (n) est le produit de (n) par la factorielle de (n - 1). Sachant que la factorielle (0) est (1). Ouvrir un éditeur de texte selon votre choix (Notepad++). Editer le programme C. Exécuter le programme.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#recursivite_factorielle-de--n-">Factorielle de (n)</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#recursivite_ce-qu-il-faut-savoir">Ce qu'il faut savoir</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#ligne-de-commande_programme-principal">Programme principal</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#ligne-de-commande_resultat">Résultat</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="recursivite_factorielle-de--n-" href="#recursivite">Factorielle de (n)</a>
</h2><br><div class="GFormula1 Formula1">\begin{eqnarray}
n! &amp;=&amp; \prod_{i=1}^n i\\
n! &amp;=&amp; 1 \times 2 \times 3 \times ... \times (n-1) \times n\\
n! &amp;=&amp; n \times \prod_{i=1}^{n-1} i\\
n! &amp;=&amp; n \times (n-1)!
\end{eqnarray}
</div><br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="recursivite_ce-qu-il-faut-savoir" href="#recursivite">Ce qu'il faut savoir</a>
</h2><br>Il nous faut une condition fin. On s'arrêtera lorsque l'entier (n) vaudra (0) et on retournera la valeur (1).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ligne-de-commande_programme-principal" href="#recursivite">Programme principal</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
#include &lt;stdio.h&gt;
#include &lt;stdlib.h&gt;
//===============================================
int factorial(int n) {
    if(n == 0) return 1;
    return (n * factorial(n - 1));
}
//===============================================
int main(int _argc, char** _argv) {
    for(int i = 0; i &lt; 10; i++) {
        printf("Factorielle(%d) : %d\n", i, factorial(i));
    }
    exit(EXIT_SUCCESS);
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ligne-de-commande_resultat" href="#recursivite">Résultat</a>
</h2><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="arguments-variables">Arguments variables</a>
</h1>
<div class="Section6"><br>Nous essayerons de déterminer la moyenne d'un ensemble de (n) nombres réels représentant des notes à partir d'une fonction en faisant passer la liste des notes comme argument de la fonction. Ouvrir un éditeur de texte selon votre choix (Notepad++). Editer le programme C. Exécuter le programme.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#arguments-variables_ce-qui-nous-faut-savoir">Ce qui nous faut savoir</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#ligne-de-commande_programme-principal">Programme principal</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#ligne-de-commande_resultat">Résultat</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="arguments-variables_ce-qui-nous-faut-savoir" href="#arguments-variables">Ce qui nous faut savoir</a>
</h2><br>Il nous faut un argument pivot à partir duquel on définira la liste des arguments variables. On utilisera l'entier (n) correspondant au nombre de notes comme argument pivot.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ligne-de-commande_programme-principal" href="#arguments-variables">Programme principal</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
#include &lt;stdio.h&gt;
#include &lt;stdarg.h&gt;
//===============================================
double average(int n, ...) {
    double lSum = 0.0;

    va_list lArgs;
    va_start(lArgs, n);

    for (int i = 0; i &lt; n; i++) {
        double lNote = va_arg(lArgs, double);
        lSum += lNote;
    }

    va_end(lArgs);

    double lAverage = lSum/n;
    return lAverage;
}
//===============================================
int main(int _argc, char** _argv) {
    printf("Moyenne(10.0, 5.0) : %.2f\n", average(2, 10.0, 5.0));
